import React, {Component} from 'react'
import PlannedPromoPipeline from './PlannedPromoPipeline'

class FinalizePromo extends Component {
    render() {
        return (
            <PlannedPromoPipeline page={2} />
        )
    }
}

export default FinalizePromo
